import React from 'react';
import ReactDOM from 'react-dom/client';
import Login from './Login';
import Signup from './Signup';

function App() {
  return (
    <div>
      <Login />
      <Signup />
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
